{DOUBLE BREAKER}
■ When you put this creature or whenever it attacks, draw 2 cards, then discard a card from your hand.
■ Each turn, when a spell that costs 5 or less is discarded from your hand for the first time, you may cast that spell for no cost.

■ This creature costs 1 less to summon for each of your creatures in your graveyard. It can't cost 0 or less.
■ When you put this creature, choose one of your opponent's creatures. That creature gets -1000 power for each creature in your graveyard until the end of the turn.
{DOUBLE BREAKER}

{TRIPLE BREAKER}
■ If you have less than 13 cards in your graveyard, this creature can't attack.
■ At the end of your turn, you may put the top card of your deck into your graveyard.
